(6610152, 2566, 10152, 'ผลผลิตที่ 10.1', 'โครงการพัฒนาการดำเนินงานการเฝ้าระวังโรคและภัยสุขภาพในพื้นที่เขตพัฒนาพิเศษภาคตะวันออก', 'โครงย่อย 5', 'โครงย่อย 5', 'กิจกรรมที่ 2', 'ประชุมเชิงปฏิบัติการฝึกซ้อมแผนตอบโต้ภาวะฉุกเฉินทางสาธารณสุขในพื้นที่เขตพัฒนาพิเศษภาคตะวันออก', '2.งบดำเนินงาน', '2.1 งบโครงการ ป.เชิงฯ'),
(6610153, 2566, 10153, 'ผลผลิตที่ 10.1', 'โครงการพัฒนาการดำเนินงานการเฝ้าระวังโรคและภัยสุขภาพในพื้นที่เขตพัฒนาพิเศษภาคตะวันออก', 'โครงย่อย 5', 'โครงย่อย 5', 'กิจกรรมที่ 3', 'การนิเทศติดตามประเมินสนับสนุนและสอบสวนโรคด้านการป้องกันควบคุมโรคจากการประกอบอาชีพและโรคจากสิ่งแวดล้อมในพื้นที่เขตพัฒนาพิเศษภาคตะวันออก\n', '2.งบดำเนินงาน', '2.1 งบโครงการ M&E');
